    #
    sshd_conf=`egrep "(auth|account)" /etc/pam.d/sshd 2> /dev/null`
    if [ $? -ne 0 ]; then
        # No match found
        # sshd not explicitly configured.
        # Use passwd

        if [ -e "/etc/debian_version" ]; then
